import React from "react";

const ItemsList = (props) => {
  return (
    <>
      {props.images.map((image) => (
        <div key={image.id} className="col-auto card bg-dark text-white">
          <img src={image.previewURL} alt="" className="card-img fit"/>

        </div>
      ))}
    </>
  );
};
export default ItemsList;
